import React from 'react';

const HeroCards = (props) => {
  const { movies: id, title, desc, thumbnail } = this.props;
  return (
    <article key={id} className='card'>
      <h2>{title}</h2>
      <p>{desc}</p>
      <img src={thumbnail} alt={title} />
    </article>
  );
};

export default HeroCards;
